import React from "react";
import ContentItem from "./contentItem";
import './contentStyle.css';

class Content extends React.Component {
    render() {
        return(
            <div className="contentContainer">
                <div className="contentItem">
                    <ContentItem/>
                    <ContentItem/>
                </div>
                <div className="contentItem">
                    <ContentItem/>
                    <ContentItem/>
                </div>
            </div>
        )
    }
}

export default Content;
